019_43:"Marymount Secondary School",schools2019_44:"Ying Wa College",schools2019_45:"St. Joseph College ",schools2019_46:"Toi Shan Ass. College",schools2019_47:"United Christian College (Kowloon East)",schools2019_48:"Methodist College",schools2019_49:"Pentecostal Lam Hon Kwong School",schools2019_50:"TWG Hs Li Ka Shing College",schools2019_51:"SALEM-Immanuel Lutheran College",schools2019_52:"Queen’s College",schools2019_53:"Ying Wa Girls’ School",schools2019_54:"Maryknoll Convent School",name2018:"The Tempest 2018 ",conduct2018_1:"Adapted and Directed by Shiona Carson",conduct2018_2:"Performed by Primary & Secondary School Students in English (with Bilingual Subtitles)Approximately 2 hours with 15 minutes intermission",address2018:"Tuen Mun Town Hall Auditorium",time2018_1:"06.10.2018 (Sat) 2.30pm,06.10.2018 (Sat) 7.30pm",time2018_2:"07.10.2018 (Sun) 2.30pm",sponsor2018_1:"The Hong Kong Jockey Club Charities Trust；First Initiative Foundation",sponsor2018_2:"Swire Properties",sponsor2018_3:"",sponsor2018_4:"",sponsor2018_5:"",sponsor2018_6:"G2000",sponsor2018_7:"",sponsor2018_8:"Hong Kong Youth Music Culture Society",sponsor2018_9:"",detail_t2018:"Synopsis:The Tempest is a tale of where resolution is achieved by magic.",detail_c2018_1:"It is twelve years since Antonio and his friend the King of Siam, Alonso, seized the dukedom of Bangkok from Antonio’s widowed sister Prospero, who inherited the position of Duchess after her husbands’ death. Antonio had forced Prospero and her young daughter Miranda onto an unseaworthy boat and they were launched out to sea where they eventually reached a far-off island. The boat contained some hidden books planted by Gonzalo, a lord loyal to Prospero and her late husband. Prospero resorted to these books which explained to her the art of magic. This proved to be a vital tool for their survival and future act of revenge.",detail_c2018_2:"Upon arriving at the island Prospero discovers a transforming shape spirit called Ariel who is trapped in a spell, and imprisoned in a pine tree left by the dead witch Sycorax. Prospero frees Ariel from the tree and in return Ariel becomes her most loyal servant obeying all of Prospero’s commands. Ariel displays complete devotion to Prospero knowing that with Prospero’s promise one day she will be set free. Though the witch Sycorax has long met her demise, she left behind a monsterous son called Caliban. Prospero tried to educate Caliban but turns him into a slave after he assaulted Miranda.",detail_c2018_3:"Prospero tells this story to her daughter after the raising of a magical storm which has cast Alonso, Antonio, Alonso’s son Ferdinand, his brother Sebastian, and attendant lords onto the island. Ariel leads Ferdinand to Prospero’s cell where he falls instantly in love with Miranda, without the help of any magic. Prospero sets Ferdinand to work with menial tasks to prove his worth to Miranda. Alonso believes his son Ferdinand to be drowned. Antonio and Sebastian plan to murder Alonso when he sleeps, but thanks to Ariel this ambitious and cruel deed does not happen. Stephano the drunk butler, and Trinculo, the King’s jester, fall into a drunken conspiracy to collaborate with Caliban to overthrow Prospero and take over the island.",detail_c2018_4:"With magic and the help of Ariel, Prospero confuses the King and those who previously conspired against her. Prospero organizes a betrothal ceremony for Miranda and Ferdinand. After seeing her enemies suffer enough. Prospero decides to abandon her desire for revenge, forgives her enermies, turning her back on magic forever. She reveals her part in the day’s events which had taught her enemies a valuable lesson and in so doing ceasing their wicked ways. She reunities Ferdinand with his father and introduces Miranda as Ferdinand’s future bride. Prospero then gives the island back to Caliban, sets Ariel free, as promised, and regains her position as the Duchess of Bangkok.",detail_c2018_5:"",detail_c2018_6:"",schools201